import getHaversineDistance from "./haversine.js";

export default function parse(data, location){
    var distances = new Array(data.length);
    data.forEach(function(data, index, distances){
        //console.log(data.coordinates)
        distances.push(getHaversineDistance(location, data.coordinates));
    });
    console.log(location);
    console.log(distances);
    return distances;
}
